import {TfiFaceSmile} from 'react-icons/tfi'
import { MdOutlineCleaningServices } from 'react-icons/md'
import { VscWorkspaceTrusted } from 'react-icons/vsc'


const CardData = [
    { id: 1, icon: <TfiFaceSmile/>, title: 'Smile', desc: 'A Smile Makes a Difference. Our dream as a company is to participate in making this world full of smiles, motivating others to help a hand in need and achieve success by doing so.' },
    { id: 2, icon: <MdOutlineCleaningServices/>, title: 'Services', desc: 'We will help with any type of problem, requests, tasks, and others as long as it does not involve crime or violence.' },
    { id:3, icon: <VscWorkspaceTrusted/>, title:'Trust', desc: 'Our company is filled with profesionals and veterans at their own sectors and all of our workers have been interviewed for their motives for work through a lie detector test.'}
]

export default CardData;
